"search-2\",\n                \"recent-posts-2\",\n                \"recent-comments-2\",\n                \"archives-2\",\n                \"categories-2\",\n                \"meta-2\"\n            ]\n        },\n        \"type\": \"global_variable\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-09 11:12:07\"\n    }\n}','','','trash','closed','closed','','649f011f-aca6-4d06-8631-49d52356b1b1','','','2018-10-09 11:12:07','2018-10-09 11:12:07','',0,'http://acme-wordpress.rooter.se/?p=60',0,'customize_changeset','',0),(61,1,'2018-10-09 11:12:22','2018-10-09 11:12:22','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2018-10-09 11:12:22','2018-10-09 11:12:22','',1,'http://acme-wordpress.rooter.se/?p=61',0,'revision','',0),(62,1,'2018-10-09 11:14:24','2018-10-09 11:14:24','<h2>Who we are</h2><p>Our website address is: http://acme-wordpress.rooter.se.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2018-10-09 11:14:24','2018-10-09 11:14:24','',3,'http://acme-wordpress.rooter.se/2018/10/09/3-revision-v1/',0,'revision','',0),(63,1,'2018-10-09 11:14:24','2018-10-09 11:14:24','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://acme-wordpress.rooter.se/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2018-10-09 11:14:24','2018-10-09 11:14:24','',2,'http://acme-wordpress.rooter.se/2018/10/09/2-revision-v1/',0,'revision','',0),(64,1,'2018-10-09 11:17:40','2018-10-09 11:17:40','{\n    \"blogdescription\": {\n        \"value\": \"Corporation\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-09 11:17:40\"\n    }\n}','','','trash','closed','closed','','995a6ebe-874c-4e22-bc33-4a7ad2fc6b71','','','2018-10-09 11:17:40','2018-10-09 11:17:40','',0,'http://acme-wordpress.rooter.se/?p=64',0,'customize_changeset','',0),(65,1,'2018-10-09 11:25:52','0000-00-00 00:00:00','','NextGEN Basic Thumbnails','','draft','closed','closed','','','','','2018-10-09 11:25:52','0000-00-00 00:00:00','',0,'http://acme-wordpress.rooter.se/?post_type=display_type&p=65',0,'display_type','',0),(66,1,'2018-10-09 11:25:52','0000-00-00 00:00:00','','NextGEN Basic Slideshow','','draft','closed','closed','','','','','2018-10-09 11:25:52','0000-00-00 00:00:00','',0,'http://acme-wordpress.rooter.se/?post_type=display_type&p=66',0,'display_type','',0),(67,1,'2018-10-09 11:25:52','0000-00-00 00:00:00','','NextGEN Basic ImageBrowser','','draft','closed','closed','','','','','2018-10-09 11:25:52','0000-00-00 00:00:00','',0,'http://acme-wordpress.rooter.se/?post_type=display_type&p=67',0,'display_type','',0),(68,1,'2018-10-09 11:25:52','0000-00-00 00:00:00','','NextGEN Basic SinglePic','','draft','closed','closed','','','','','2018-10-09 11:25:52','0000-00-00 00:00:00','',0,'http://acme-wordpress.rooter.se/?post_type=display_type&p=68',0,'display_type','',0),(69,1,'2018-10-09 11:25:52','0000-00-00 00:00:00','','NextGEN Basic TagCloud','','draft','closed','closed','','','','','2018-10-09 11:25:52','0000-00-00 00:00:00','',